import React from 'react';
import * as C from './styles';
import Title from '../../components/Title';
import Label from '../../components/Label';
import Button from '../../components/Button';

const ConfirmEvent = ({ title = 'title', text = 'text' }) => {
    return (
        <C.Container>
            <C.ConfirmContainer>
                <Title>{title}</Title>
                <Label>{text}</Label>
                <C.ButtonContainer>
                    <Button fontSize='15px'>CONFIRMAR</Button>
                    <Button>CANELAR</Button>
                </C.ButtonContainer>
            </C.ConfirmContainer>
        </C.Container>
    )
}

export default ConfirmEvent
